INSERT INTO `posts` (`pid`, `country_id`, `user_id`, `title`, `slug`, `body`, `post_image`, `created_at`) VALUES
(27, 44, 7, 'Covid-19', 'Covid-19', '<p>Protect yourself and others around you by knowing the facts and taking appropriate precautions. Follow advice provided by your local public health agency.</p>\r\n\r\n<hr />\r\n<p>To prevent the spread of COVID-19:</p>\r\n\r\n<p>Clean your hands often. Use soap and water, or an alcohol-based hand rub.</p>\r\n\r\n<p>Maintain a safe distance from anyone who is coughing or sneezing.</p>\r\n\r\n<p>Don&rsquo;t touch your eyes, nose or mouth.</p>\r\n\r\n<p>Cover your nose and mouth with your bent elbow or a tissue when you cough or sneeze.</p>\r\n\r\n<p>Stay home if you feel unwell.</p>\r\n\r\n<p>If you have a fever, a cough, and difficulty breathing, seek medical attention. Call in advance.</p>\r\n\r\n<p>Follow the directions of your local health authority.</p>\r\n\r\n<p>Avoiding unneeded visits to medical facilities allows healthcare systems to operate more effectively, therefore protecting you and others.</p>\r\n', 'Presi.jpeg', '2020-04-26 22:08:24'),
(28, 7, 7, 'How to display Base64 images in HTML?', 'How-to-display-Base64-images-in-HTML', '<p>I believe I have discovered the problem is when the base64 file is being uploaded every &quot;+&quot; seems to be removed. Which intern nullifies the jpeg. I am posting the image from a device to the server with AJAX is it possible that &quot;+&quot; is not passed correctly throught because it is a htmlentity?</p>\r\n', 'download.jpeg', '2020-04-26 22:10:47'),
(29, 7, 7, 'Light card title', 'Light-card-title', '<p>Some quick example text to build on the card title and make up the bulk of the card&#39;s content.</p>\r\n', 'Presi.jpeg', '2020-04-26 22:13:45'),
(30, 7, 7, 'How to crop image using Croppie jQuery plugin in your web application', 'How-to-crop-image-using-Croppie-jQuery-plugin-in-your-web-application', '<p>In every social networking website, there is crop and upload functionality available in profile picture. There are many ways you can do it for your web application. One easy and quick way is to use Javascript or jQuery plugin.</p>\r\n', 'Presi.jpeg', '2020-04-26 22:16:28'),
(32, 7, 10, 'Test', 'Test', '<p>This is a new test post</p>\r\n', 'ckwf.jpg', '2020-06-01 11:28:59'),
(35, 28, 10, 'Karl D Trumpeter plays at Shouts of Victory hosted by CKWF', 'Karl-D-Trumpeter-plays-at-Shouts-of-Victory-hosted-by-CKWF', '<p>zfcvz</p>\r\n', '70826536727e46a0be20389b1cf789f5.jpg', '2020-06-01 20:14:33');

